import React from "react";



const SearchBox=({searchfield, searchChange})=>{
    return (
    <div className="pa2">
        <input 
            className="ba b--green bg-lightest-blue"
            type="search" 
            placeholder="Search vegetable" 
            onChange={searchChange}
        />
    </div>
    );
}


export default SearchBox;
